import React from "react";
import homeImage from "./pics/home.png";
import checkoutImage from "./pics/checkout.png";
import "./Header.css";

const Header = ({ name }) => {
  return (
    <header className="header-container">
      <img src={homeImage} alt="Home" className="home-image" />
      <h3>Welcome, {name} </h3>
      <h1 className="header-title">X-Fitness</h1>
      <img src={checkoutImage} alt="Check Out" className="checkout-image" />
    </header>
  );
};

export default Header;
